import React from 'react';
import { Grid,Typography,Button, AppBar, Toolbar } from '@mui/material';
import { styled } from '@mui/material/styles';
import {useNavigate} from 'react-router-dom';
import Charity from '../../images/charityHelp.jpg';

const StartButton = styled(Button)(({ theme }) => ({
  color: '#FFFFFF',
  backgroundColor: '#FFF345',
  '&:hover': {
    backgroundColor: '#000000',
  },
}));


export default function Home() {
  let navigate = useNavigate();

  let startButtonClick = ()=>{
    navigate('/login');
  }


  return (
    <div>
      <AppBar position='static'>
        <Toolbar>
          Eden's Garden
        </Toolbar>
      </AppBar>
      <Grid container columns={1}>
        <Grid item  sx={{ bgcolor: '#cfe8fc', height: '25rem', width:'100%', textAlign: 'center'}} >
          <Grid container column='2'>
            <Grid item>

            </Grid>
          </Grid>
        </Grid>
        <Grid item textAlign='center' sx={{ bgcolor: '#f32432', height: '20rem', width:'100%'}}>
          Hello World
        </Grid>
      </Grid>
    </div>
  );
}
